import React from 'react';
import '../src/index.css'
import {Routes,Route} from 'react-router-dom';
import { Who } from './Routes/Who';
import { Services } from './Routes/Services';
import { Client } from './Routes/Client';
import { Portfolio } from './Routes/Portfolio';
import { Careers } from './Routes/Careers';
import { Contact } from './Routes/Contact';
import { Home } from './Routes/Home';
import { Brand } from './Componets/Branding/Brand';
import { Web } from './Componets/Web/Web';
import { Soft } from './Componets/Software/Soft';
import { Mark } from './Componets/Navbar/Marketing/Mark';
import { Application } from './Componets/App/Application';

function App() {
  return (
    <div >
      <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/WhoWeAre" element={<Who />} />
      <Route path="/OurServices" element={<Services />} />
      <Route path="/OurClients" element={<Client />} />
      <Route path="/Portfolio" element={<Portfolio />} />
      <Route path="/Careers" element={<Careers />} />
      <Route path="/Contact" element={<Contact />} />
      <Route path="/brand" element={<Brand></Brand>} />
      <Route path="/web" element={<Web />} />
      <Route path="/soft" element={<Soft />} />
      <Route path="/application" element={<Application />} />
      <Route path="/mark" element={<Mark/>} />
      </Routes>
    </div>
  );
}

export default App;
